import React from "react";

export default function Element({
  elementName,
  elementSymbol,
  elementNumber,
  elementMass,
  elementXpos,
  elementYpos,
  elementPhase,
}) {
  return (
    <>
      <div
        className={`element ${elementName} ${elementPhase}`}
        style={{
          gridRow: elementYpos,
          gridColumn: elementXpos,
        }}
      >
        <div className="element__number">{elementNumber}</div>
        <div className="element__symbol">{elementSymbol}</div>
        <div className="element__name">{elementName}</div>
        <div className="element__mass">{elementMass}</div>
      </div>
    </>
  );
}
